import {
  RESET_USER_LIST,
  useUserContext,
} from "../../../../../store/3_context";

const ContextQ2Form3 = () => {
  const [userList, dispatch] = useUserContext();

  const handleReset = (id) => {
    dispatch(RESET_USER_LIST(id));
    const editedUserList = userList.editedUserList.filter(
      (user) => user.isEdit
    );
    console.log(editedUserList);
  };
  return (
    <div>
      <h1>Q2Form3</h1>
      <button onClick={handleReset}>RESET</button>
    </div>
  );
};
export default ContextQ2Form3;
